webpackJsonp([0xd4e90e380ad0],{375:function(t,a){t.exports={data:{site:{meta:{title:"n0の断片",description:"メモとか、スニペットとか",url:"https://tkmn0.github.io/scrap/",author:"n0",twitter:"n0",adsense:""}},post:{id:"/Users/noguchitakuma/Desktop/n0WorkSapace/techblog/blog/src/pages/articles/01072018/Gatsby/index.md absPath of file >>> MarkdownRemark",html:'<p>このブログは Gatsby というフレームワークによって書かれています。</p>\n<!--more-->\n<p>Gatsby を髪の毛以外に使えるとは思いませんでしたねぇ。<br>\nGatsby: <a href="https://github.com/gatsbyjs/gatsby">https://github.com/gatsbyjs/gatsby</a><br>\nDocument: <a href="https://www.gatsbyjs.org/docs/">https://www.gatsbyjs.org/docs/</a></p>\n<p>Document の通りすすめていけば簡単に React.js で書かれたページが作成されます。 もしくは,“Gatsby react”とかって検索していただければ日本語の記事も複数出てきます。(このページは@jaxx2104 さん作と思われるテンプレートが Gatsby の Document に乗ってる starter に含まれていたので、存分に使わせていただいております。こんなかっこいいテンプレート誠にありがとうございます。)</p>\n<p>記事の作成はマークダウン方式でガシガシ作成します。リアルタイムで記事内容が反映されていくので、書いてて楽しいですね笑。</p>\n<h2>ブログやること</h2>\n<hr>\n<ul>\n<li>コマンドで記事作成できるようにする</li>\n<li>コマンドで記事を投稿できるようにする</li>\n<li>右側に記事のカテゴリ別一覧とかを表示する</li>\n<li>前の記事、次の記事　ボタンの作成</li>\n<li>各種リンク(github, twitter)を作る(フッターかな？)</li>\n</ul>\n<p>ただ、React.js も scss も詳しくないので、時間がかかるかもなあ、というのが本音ですね。頑張っていきましょう。</p>',frontmatter:{layout:"post",title:"Gatsbyのご紹介。",path:"/01072018/gatsby01/",categories:["ブログ"],date:"2018/01/06"}}},pathContext:{path:"/01072018/gatsby01/"}}}});
